'use strict';const {PrismaClient}=require("./app/generated/prisma/client"),prisma=new PrismaClient;
async function main(){try{console.log("Checking person relations...");const a=await prisma.person_relations.findMany({include:{from_person:{select:{id:!0,first_name:!0,last_name:!0,userId:!0}},to_person:{select:{id:!0,first_name:!0,last_name:!0,userId:!0}}}});console.log("Person Relations:",a);const b=await prisma.persons.findMany({select:{id:!0,first_name:!0,last_name:!0,userId:!0}});console.log("Persons:",b)}catch(a){console.error("Error:",a)}finally{await prisma.$disconnect()}}main();